import CoverImage from "./components/CoverImage"
import ProfilePicture from "./components/ProfilePicture"
import PersonalInfo from "./components/PersonalInfo"

const App = () => {

  const space_between_elements = "4.5vh"

  const mainContainer =  {
    maxWidth: "400px",
    margin: "0 auto"
  }

  return (
    <div style = {mainContainer}>
      <CoverImage />
      <ProfilePicture />
      <PersonalInfo space_between_elements = {space_between_elements} />
    </div>

  )
}

export default App
